INSERT INTO `posts` (`post_id`, `title`, `content`, `category`, `createdAt`, `updatedAt`) VALUES
(1, 'Qairline chính thức khai trương đường bay thẳng đến châu Âu', 'Hãng hàng không Qairline tự hào thông báo khai trương đường bay thẳng từ Hà Nội và TP.HCM đến Madrid (Tây Ban Nha) và Munich(Đức). Đây là bước tiến chiến lược nhằm mở rộng mạng lưới quốc tế, mang đến trải nghiệm bay cao cấp và tiện lợi cho hành khách.', 'news', '2024-12-19 08:29:00', '2024-12-19 08:29:00'),
(2, 'Qairline nhận thêm 3 máy bay Boeing 787 Dreamliner hiện đại', 'Để nâng cao chất lượng dịch vụ và mở rộng thị trường, Qairline vừa bổ sung vào đội bay 3 chiếc Boeing 787 Dreamliner. Với thiết kế rộng rãi, tiết kiệm nhiên liệu và công nghệ tiên tiến, đây sẽ là đội bay chính phục vụ các tuyến đường dài quốc tế.', 'news', '2024-12-19 08:42:22', '2024-12-19 08:42:22'),
(3, 'Qairline lọt Top 10 hãng hàng không mới tốt nhất thế giới', 'Theo bình chọn từ Skytrax, Qairline đã vinh dự lọt vào danh sách Top 10 hãng hàng không mới tốt nhất thế giới, nhờ vào dịch vụ xuất sắc và trải nghiệm khách hàng được đánh giá cao.', 'news', '2024-12-19 08:45:06', '2024-12-19 08:45:06'),
(4, 'Lần đầu tiên Qairline ra mắt đội ngũ tiếp viên với đồng phục mới', 'Đồng phục tiếp viên mới của Qairline đã được công bố, lấy cảm hứng từ văn hóa Việt Nam và phong cách hiện đại. Thiết kế này vừa thể hiện sự thanh lịch, vừa mang tính nhận diện thương hiệu cao.', 'news', '2024-12-19 08:47:34', '2024-12-19 08:47:34'),
(5, 'Qairline hợp tác với Booking.com để cung cấp dịch vụ đặt khách sạn', 'Qairline và Booking.com chính thức hợp tác, mang đến cho hành khách dịch vụ đặt phòng khách sạn dễ dàng, nhanh chóng ngay trong quá trình đặt vé máy bay.', 'news', '2024-12-19 08:51:16', '2024-12-19 08:51:16'),
(6, 'Qairline tiên phong sử dụng nhiên liệu xanh bảo vệ môi trường', 'Thực hiện nghị định số 49/2022/NĐ-CP về vấn đề bảo vệ môi trường ngành hàng không, Qairline cam kết giảm lượng khí thải carbon thông qua việc sử dụng nhiên liệu hàng không bền vững (SAF). Đây là một phần trong chiến lược phát triển bền vững của hãng.', 'news', '2024-12-19 08:54:51', '2024-12-19 08:54:51'),
(7, 'Thị trường Mỹ đón nhận Qairline với sự kiện ra mắt tại Los Angeles', 'Qairline đã tổ chức sự kiện hoành tráng tại Los Angeles để chào đón đường bay thẳng từ Việt Nam đến Mỹ. Đây là cột mốc quan trọng, mang lại cơ hội kết nối hai quốc gia.', 'news', '2024-12-19 09:03:46', '2024-12-19 09:03:46'),
(8, 'Qairline triển khai công nghệ Wi-Fi tốc độ cao trên mọi chuyến bay', 'Hành khách giờ đây có thể truy cập Wi-Fi tốc độ cao trên mọi chuyến bay của Qairline, giúp bạn luôn kết nối với công việc và giải trí ngay cả khi đang bay.', 'news', '2024-12-19 09:07:25', '2024-12-19 09:07:25'),
(9, 'Cập nhật: Lịch bay mới cho mùa Tết Nguyên Đán 2024', 'Qairline tăng cường chuyến bay nội địa và quốc tế để đáp ứng nhu cầu di chuyển dịp Tết. Hãy nhanh tay đặt vé để không bỏ lỡ cơ hội đoàn tụ gia đình.', 'news', '2024-12-19 09:22:51', '2024-12-19 11:16:55'),
(10, 'Qairline đạt giải thưởng \"Hãng hàng không phục vụ tốt nhất Đông Nam Á\"', 'Với sự nỗ lực không ngừng, Qairline vừa nhận được giải thưởng \"Hãng hàng không phục vụ tốt nhất Đông Nam Á\" từ Tổ chức Hàng không Quốc tế (IATA). Qairline vô cùng vinh dự và hân hoan khi được góp mặt và trao giải thưởng trong một sự kiện danh giá của tổ chức Hàng không hàng đầu thế giới APEX và Skytrax. ', 'news', '2024-12-19 09:28:33', '2024-12-19 12:04:56'),
(11, 'Kinh nghiệm \"săn\" vé giá rẻ từ Qairline', 'Qairline chia sẻ các mẹo săn vé giá rẻ: đặt vé sớm, chọn giờ bay ít phổ biến và tận dụng các chương trình khuyến mãi định kỳ.\r\nViệc săn vé máy bay giá rẻ luôn là điều mà nhiều người yêu du lịch quan tâm, nhất là khi bạn mong muốn tiết kiệm chi phí chuyến đi. Dưới đây là những kinh nghiệm quý giá giúp bạn \"săn\" được vé máy bay giá rẻ từ Qairline:\r\n\r\n1. Theo dõi Chương Trình Khuyến Mãi: Đăng ký nhận email từ Qairline để không bỏ lỡ cơ hội khuyến mãi nào.\r\n\r\n2. Lựa Chọn Thời Gian Bay Phù Hợp: Bay vào giờ ít cao điểm, tránh bay ngày lễ lớn, lập kế hoạch bay sớm\r\n\r\n3. Săn Vé Vào Giờ \"Vàng\": Qairline thường mở bán vé giá rẻ vào những giờ định kỳ trong ngày. Hãy theo dõi các đợt bán vé flash sale, thường là từ 0h00 hoặc trong khung giờ ít người truy cập.\r\n', 'news', '2024-12-19 09:33:53', '2024-12-19 09:33:53'),
(12, 'Khuyến mãi Tết: Giảm 40% cho mọi loại vé', 'Mừng Tết Nguyên Đán, Qairline giảm giá 40% cho tất cả các vé nội địa và quốc tế. Áp dụng mã giảm giá TET40 để nhận ngay ưu đãi. Thời gian áp dụng: từ 15/12/2023 đến 25/1/2024.', 'promotion', '2024-12-19 09:54:53', '2024-12-19 09:54:53'),
(13, 'Tiết Kiệm Lớn Cùng Qairline: Ưu Đãi 50% Cho Các Chuyến Bay Quốc Nội', 'Hãy tận hưởng mùa hè này với các chuyến bay quốc nội siêu tiết kiệm từ Qairline. Chúng tôi mang đến ưu đãi đặc biệt giảm giá lên đến 50% cho các chuyến bay khởi hành từ nay đến cuối tháng. Đặt vé ngay hôm nay và khám phá vẻ đẹp đất nước với mức giá vô cùng hấp dẫn! Nhập ngay mã VN100 để trải nghiệm chương trình', 'promotion', '2024-12-19 11:06:14', '2024-12-19 11:06:14'),
(14, 'Khuyến Mãi Đặc Biệt: Hỗ trợ giá vé chỉ dành cho hội viên', 'Để tri ân sự đồng hành của khách hàng trong suốt thời gian qua, Qairline xin tặng mã khuyến mãi khi mua vé máy bay từ nay đến hết tháng này. Hãy nhanh tay đặt vé và nhận ngay quà tặng từ chúng tôi! Áp dụng mã SP20 để rinh ngay vé giá rẻ về nhà.', 'promotion', '2024-12-19 12:21:38', '2024-12-19 12:21:38'),
(15, 'Qairline ra mắt chuyến bay mới một chạm đi thẳng đến Tokyo', 'Chúng tôi rất vui mừng thông báo rằng Qairline sẽ chính thức khai trương chuyến bay đến Tokyo từ ngày 03 tháng 01 năm 2025. Đặt vé ngay để khám phá thủ đô Nhật Bản với các dịch vụ tiện ích và chuyến bay thoải mái nhất!', 'announcement', '2024-12-19 12:24:41', '2024-12-19 12:24:41'),
(16, 'Cập Nhật Lịch Bay: QAirline Đổi Giờ Khởi Hành Một Số Chuyến Bay', 'Để phục vụ tốt hơn nhu cầu của hành khách, QAirline thông báo sẽ thay đổi giờ khởi hành của một số chuyến bay. Hành khách vui lòng kiểm tra lại thông tin lịch bay mới nhất trước khi lên đường. Thông tin có thể xem chi tiết trong file đính kèm.', 'announcement', '2024-12-19 12:30:27', '2024-12-19 13:55:47'),
(17, 'Giờ vàng khuyến mãi Qairline – Cơ hội \"vàng\" để bay giá rẻ!', 'Giờ Vàng Khuyến Mãi của Qairline là cơ hội tuyệt vời để bạn sở hữu những tấm vé máy bay giá rẻ đến bất ngờ. Chương trình diễn ra hàng ngày từ 12:00 trưa đến 13:00 chiều, và đặc biệt vào thứ Sáu hàng tuần còn có thêm khung giờ ưu đãi từ 8:00 tối đến 10:00 tối với nhiều ưu đãi hấp dẫn hơn. Trong thời gian này, bạn có thể săn vé nội địa chỉ từ 99.000 VNĐ mỗi chiều (chưa bao gồm thuế và phí) hoặc vé quốc tế với mức giảm giá lên đến 50%, áp dụng cho các tuyến phổ biến như Singapore, Bangkok, Seoul và Tokyo. Đặc biệt, nếu bạn đặt vé theo nhóm từ 3 người trở lên, bạn sẽ nhận được ưu đãi giảm thêm 10% trên tổng giá trị đặt vé.', 'promotion', '2024-12-19 13:44:03', '2024-12-19 13:44:03'),
(19, 'QAirline hợp tác với các sân bay quốc tế mới: Mở Rộng Cánh Cửa Đón Chào Toàn Cầu', 'Qairline tự hào thông báo việc mở rộng mạng lưới hợp tác với các sân bay quốc tế hàng đầu thế giới, đánh dấu một bước tiến quan trọng trong chiến lược phát triển toàn cầu của hãng. Với sứ mệnh mang đến những trải nghiệm bay chất lượng và thuận tiện nhất cho hành khách, chúng tôi đã thiết lập quan hệ hợp tác với các sân bay nổi tiếng tại Nhật Bản, Mỹ, Đức và nhiều quốc gia khác.\r\n\r\nTại Nhật Bản, Qairline chính thức hợp tác với Sân bay Quốc tế Narita (Tokyo) và Sân bay Quốc tế Kansai (Osaka). Đây là hai trung tâm hàng không lớn của Nhật Bản, nổi tiếng với cơ sở hạ tầng hiện đại và dịch vụ xuất sắc. Sự hợp tác này sẽ giúp hành khách của Qairline tiếp cận dễ dàng hơn với những thành phố sôi động, văn hóa độc đáo và cảnh quan tuyệt đẹp của đất nước mặt trời mọc.\r\n\r\nỞ Mỹ, Qairline đã thiết lập quan hệ với các sân bay hàng đầu như Sân bay Quốc tế Los Angeles (LAX) và Sân bay Quốc tế John F. Kennedy (JFK) tại New York. Đây là những cửa ngõ hàng không quan trọng, kết nối hành khách với những trung tâm kinh tế, văn hóa và giải trí bậc nhất thế giới. Việc hợp tác này không chỉ giúp mở rộng mạng lưới bay của Qairline mà còn mang đến nhiều lựa chọn hành trình thuận tiện hơn cho hành khách.\r\n\r\nTại Đức, Qairline đã đạt được thỏa thuận hợp tác với Sân bay Quốc tế Frankfurt (FRA), một trong những trung tâm hàng không lớn nhất châu Âu. Frankfurt không chỉ là cánh cửa dẫn vào châu Âu mà còn là đầu mối giao thương quan trọng giữa các châu lục. Sự hợp tác này sẽ giúp hành khách Qairline dễ dàng tiếp cận với các quốc gia châu Âu và trải nghiệm dịch vụ hàng không đẳng cấp.\r\n\r\nNhững mối quan hệ hợp tác này không chỉ nhằm mục đích mở rộng mạng lưới bay mà còn mang lại nhiều lợi ích trực tiếp cho hành khách. Từ việc cải thiện trải nghiệm tại sân bay, tăng cường dịch vụ hỗ trợ khách hàng, đến việc tối ưu hóa thời gian nối chuyến, tất cả đều hướng đến sự hài lòng của khách hàng. Ngoài ra, Qairline cũng không ngừng mở rộng hợp tác với các sân bay khác trên thế giới để mang đến nhiều hành trình mới, kết nối nhiều điểm đến thú vị.\r\n\r\nVới tầm nhìn trở thành hãng hàng không hàng đầu khu vực trong năm 2025, Qairline cam kết không ngừng nỗ lực để cải thiện và phát triển. Sự hợp tác với các sân bay quốc tế lần này là minh chứng rõ ràng cho cam kết đó, đồng thời khẳng định vị thế của Qairline trên bản đồ hàng không toàn cầu. Hãy cùng Qairline khám phá những chân trời mới, từ Tokyo đến New York, từ Frankfurt đến nhiều điểm đến hấp dẫn khác trên thế giới!', 'announcement', '2024-12-19 13:49:00', '2024-12-19 13:55:37'),
(20, 'Sửa đổi, Bổ sung Thông tư 17/2019/TT-BGTVT về Khung Giá Dịch Vụ Vận Chuyển Hành Khách Nội Địa', 'Bộ Giao thông Vận tải vừa ban hành Thông tư sửa đổi, bổ sung một số điều của Thông tư số 17/2019/TT-BGTVT ngày 03/5/2019 về khung giá dịch vụ vận chuyển hành khách trên các đường bay nội địa. Sự thay đổi lần này nhằm đáp ứng thực tế vận hành, đảm bảo cân bằng giữa lợi ích doanh nghiệp, người dân và yêu cầu quản lý nhà nước.\r\n\r\nNhững điểm sửa đổi tập trung vào việc điều chỉnh mức giá trần và giá sàn vé máy bay nội địa. Cụ thể, mức giá trần được xem xét điều chỉnh để phản ánh chi phí nhiên liệu và dịch vụ tăng cao, trong khi giá sàn được sửa đổi nhằm hạn chế cạnh tranh không lành mạnh và đảm bảo chất lượng dịch vụ. Các tuyến bay có lưu lượng hành khách lớn và các tuyến bay phục vụ vùng sâu, vùng xa cũng được xem xét kỹ lưỡng để cân đối quyền lợi giữa các bên.\r\n\r\nViệc sửa đổi này không chỉ giúp thị trường hàng không phát triển bền vững mà còn đảm bảo quyền lợi của hành khách trong việc tiếp cận dịch vụ vận chuyển công bằng, minh bạch. Các hãng hàng không và cơ quan quản lý đang phối hợp để triển khai thực hiện đồng bộ, nhằm đảm bảo sự thuận tiện và minh bạch cho khách hàng cũng như doanh nghiệp.', 'announcement', '2024-12-19 13:54:28', '2024-12-19 13:54:28'),
(21, 'QAirline: Định Hướng Phát Triển Và Sứ Mệnh Mang Lại Trải Nghiệm Bay Tuyệt Vời', 'Qairline được thành lập với khát vọng trở thành hãng hàng không hàng đầu, mang lại trải nghiệm bay đẳng cấp và đáng nhớ cho mỗi hành khách. Với tầm nhìn xa và chiến lược phát triển bền vững, Qairline không chỉ tập trung vào việc mở rộng mạng lưới đường bay mà còn hướng đến nâng cao chất lượng dịch vụ trên mọi chuyến bay.\r\n\r\nSứ mệnh của Qairline là kết nối thế giới, đưa hành khách đến với những hành trình mơ ước một cách an toàn, thuận tiện và thoải mái. Chúng tôi luôn đặt trải nghiệm của khách hàng lên hàng đầu, từ sự tiện nghi trên khoang máy bay, dịch vụ chăm sóc tận tình, đến những công nghệ hiện đại nhằm tối ưu hóa quy trình đặt vé và hành trình bay.\r\n\r\nQairline cũng cam kết phát triển bền vững bằng cách hợp tác với các sân bay quốc tế hàng đầu, triển khai các giải pháp thân thiện với môi trường và xây dựng một đội ngũ nhân viên chuyên nghiệp, tận tâm. Với sự nỗ lực không ngừng, chúng tôi hy vọng sẽ trở thành người bạn đồng hành đáng tin cậy của bạn trên mọi chặng đường.\r\n\r\nCùng Qairline, mỗi chuyến bay không chỉ là việc di chuyển mà còn là trải nghiệm đáng nhớ, nơi bạn có thể cảm nhận sự thoải mái, tiện lợi và những giá trị mà chúng tôi mang lại. Chúng tôi không ngừng vươn xa, để hành trình của bạn luôn trọn vẹn.', 'about', '2024-12-19 13:57:30', '2024-12-19 13:57:30'),
(22, 'QAirline: Những Cột Mốc Lịch Sử Quan Trọng', 'Qairline, kể từ khi thành lập, đã ghi dấu ấn với những cột mốc đáng tự hào, minh chứng cho sự phát triển không ngừng và khát vọng vươn xa. Hành trình này không chỉ là những con số tăng trưởng mà còn là câu chuyện về nỗ lực, đổi mới và sự gắn kết bền chặt với khách hàng.\r\n\r\nNgay từ những chuyến bay đầu tiên, Qairline đã khẳng định vị thế với cam kết mang đến dịch vụ an toàn và chất lượng. Thành công mở đường bay quốc tế đầu tiên là bước ngoặt quan trọng, giúp kết nối hành khách đến với các trung tâm kinh tế và văn hóa lớn trên thế giới. Việc mở rộng đội bay với các dòng máy bay hiện đại không chỉ tăng cường năng lực phục vụ mà còn nâng cao trải nghiệm bay cho hành khách.\r\n\r\nNăm qua, Qairline đã đạt được nhiều thành tựu đáng nhớ, từ việc triển khai hệ thống đặt vé trực tuyến thông minh, áp dụng công nghệ trí tuệ nhân tạo trong quản lý hành trình, đến những giải thưởng uy tín trong ngành hàng không. Đây chính là sự công nhận cho những nỗ lực bền bỉ của cả tập thể.\r\n\r\nKhông dừng lại ở đó, Qairline tiếp tục đặt mục tiêu phát triển mạng lưới đường bay rộng khắp, xây dựng quan hệ hợp tác chiến lược với các sân bay và hãng hàng không lớn trên toàn cầu. Với từng cột mốc lịch sử, chúng tôi tự hào là người bạn đồng hành đáng tin cậy của hàng triệu hành khách trên hành trình chinh phục những giấc mơ.\r\n\r\nNhìn lại quá khứ để trân trọng những thành quả và hướng tới tương lai với sự quyết tâm không ngừng, Qairline cam kết mang lại những trải nghiệm ngày càng tuyệt vời hơn cho mọi hành trình. Chúng tôi tự hào khi mỗi chuyến bay của Qairline không chỉ là một chặng đường mà còn là một dấu ấn lịch sử được viết nên cùng bạn.', 'about', '2024-12-19 14:04:44', '2024-12-19 14:04:44'),
(23, 'QAirline: Tiêu chí an toàn và chất lượng dịch vụ', 'QAirline, với mục tiêu mang đến trải nghiệm bay hoàn hảo cho hành khách, luôn đặt yếu tố an toàn và chất lượng dịch vụ lên hàng đầu. Mỗi chuyến bay của QAirline được triển khai với một hệ thống kiểm tra an toàn nghiêm ngặt, từ việc bảo dưỡng máy bay đến việc huấn luyện đội ngũ phi công và tiếp viên, nhằm đảm bảo hành khách luôn cảm thấy yên tâm. Các tiêu chuẩn quốc tế về an toàn hàng không được tuân thủ chặt chẽ, giúp hành khách có thể tin tưởng vào một chuyến bay suôn sẻ và an toàn.\r\n\r\nNgoài ra, chất lượng dịch vụ của QAirline cũng là một điểm mạnh nổi bật. Dù là chuyến bay quốc tế hay nội địa, hành khách luôn được phục vụ với thái độ tận tình, chu đáo và chuyên nghiệp. Mỗi chi tiết, từ khâu đặt vé trực tuyến cho đến trải nghiệm trong suốt chuyến bay, đều được tối ưu hóa để mang lại sự thoải mái và tiện lợi nhất. QAirline không ngừng cải tiến và nâng cao dịch vụ khách hàng, cam kết mang đến sự hài lòng tối đa cho mọi hành khách, góp phần khẳng định vị thế của hãng trong ngành hàng không.\r\n\r\n', 'about', '2024-12-19 14:07:31', '2024-12-19 14:07:31'),
(24, 'Câu chuyện thành công của QAirline', 'Câu chuyện thành công của QAirline là minh chứng cho sự kết hợp hoàn hảo giữa tầm nhìn chiến lược và cam kết không ngừng cải tiến chất lượng dịch vụ. Từ những ngày đầu thành lập, QAirline đã khẳng định mình bằng việc cung cấp những chuyến bay an toàn, tiện nghi và đáng tin cậy. Với đội ngũ nhân viên chuyên nghiệp và công nghệ hiện đại, hãng đã xây dựng được lòng tin từ hành khách trong và ngoài nước. QAirline không chỉ chú trọng đến sự an toàn, mà còn nỗ lực mang đến những trải nghiệm bay tuyệt vời, từ dịch vụ chăm sóc khách hàng tận tình cho đến sự đổi mới trong các dịch vụ tiện ích trên chuyến bay. Thành công của QAirline không chỉ được đo bằng sự phát triển vượt bậc về mặt doanh thu, mà còn bằng sự hài lòng và tin tưởng của khách hàng, vững vàng trong lòng hành khách suốt nhiều năm qua.', 'about', '2024-12-19 14:16:00', '2024-12-19 14:16:00'),
(25, 'Hướng dẫn cách đặt vé trên QAirline từ A đến Z', 'Để đặt vé trên QAirline, bạn chỉ cần vào website hoặc ứng dụng, chọn loại chuyến bay (một chiều hoặc khứ hồi), điền điểm đi và điểm đến cùng ngày bay. Sau đó, chọn hạng ghế (Phổ thông, Thương gia, Hạng nhất), chọn ghế ngồi yêu thích từ bản đồ ghế, và bổ sung các dịch vụ như hành lý ký gửi hoặc chỗ ngồi ưu tiên nếu cần. Nếu có mã giảm giá, điền vào ô \"Mã giảm giá\" để tiết kiệm chi phí. Sau khi kiểm tra lại thông tin chuyến bay và giá vé, bạn xác nhận thanh toán và nhận thông báo xác nhận vé.', 'about', '2024-12-19 16:12:20', '2024-12-19 16:13:07'),
(26, 'Các hạng ghế hãng hàng không QAirline cung cấp phục vụ cho quý hành khách', 'Hạng Phổ Thông\r\nHạng Phổ Thông của QAirline mang đến sự thoải mái và tiện lợi với các dịch vụ cơ bản nhưng đầy đủ. Hành khách sẽ được phục vụ một bữa ăn cơ bản trong suốt chuyến bay, với các món ăn ngon miệng và dễ chịu. Ghế ngồi tiêu chuẩn giúp bạn cảm thấy thoải mái trong suốt hành trình, phù hợp cho những chuyến bay ngắn và trung bình. Đây là lựa chọn tuyệt vời cho những ai tìm kiếm một chuyến bay tiết kiệm và hiệu quả mà vẫn đảm bảo sự thoải mái tối thiểu.\r\n\r\nHạng Thương Gia\r\nHạng Thương Gia của QAirline mang đến trải nghiệm bay cao cấp hơn với các dịch vụ đặc biệt. Hành khách được thưởng thức những bữa ăn cao cấp, kết hợp với các loại đồ uống sang trọng, giúp chuyến bay trở nên đẳng cấp. Ghế thương gia rộng rãi với không gian thoải mái giúp bạn thư giãn và nghỉ ngơi tốt nhất. Ngoài ra, hành khách cũng sẽ được truy cập vào dịch vụ Wi-Fi miễn phí và các chương trình giải trí cao cấp, tạo nên một chuyến bay vừa thoải mái vừa thú vị.\r\n\r\nHạng Nhất\r\nHạng Nhất của QAirline là lựa chọn tuyệt vời dành cho những ai muốn trải nghiệm dịch vụ sang trọng bậc nhất. Hành khách sẽ được tận hưởng giường nằm hạng nhất, đảm bảo giấc ngủ ngon và thư giãn trong suốt chuyến bay dài. Ẩm thực 5 sao với các món ăn tinh tế và dịch vụ VIP sẽ khiến bạn cảm thấy như đang ở trong một khách sạn cao cấp. Ngoài ra, giải trí độc quyền và quầy bar riêng sẽ mang đến cho bạn những phút giây thư giãn tuyệt vời, tạo nên một chuyến bay đẳng cấp mà ít hãng hàng không có thể sánh kịp.', 'about', '2024-12-19 16:38:47', '2024-12-19 16:38:47');
